function App() {
  return (
    <div className="App">
      <h1>Mi aplicaci√≥n con mapa</h1>
      {/* Pasa los datos al componente Mapa */}
      <Mapa datosGeoJSON={datosGeoJSON} />
    </div>
  );
}

export default App;
